def rc(segment: str) \
        -> str:
    """
    Obtain the reverse complementary of a DNA segment.

    :param segment: predetermined DNA segment.
    :type segment: str

    :return: reverse complementary DNA segment.
    :rtype: str
    """
    return segment[::-1].translate(str.maketrans("ACGT", "TGCA"))


if __name__ == '__main__':
    p = ""
    print(rc(p))
